import React, { useEffect } from "react";
import WeatherCard from "./weatherCard";

const weatherCards = ({ weather }) => {
  useEffect(() => {
    const index = findNextDay();
    console.log(index);
  });

  const findNextDay = () => {
    const weatherDate = weather.list[0].dt_txt;
    const dateString = weatherDate.split(" ");

    console.log(dateString);
    const date = new Date(dateString);
    console.log(date);
    return date;
  };

  return (
    <div>
      <ul>
        <li>
          <WeatherCard weather={weather}></WeatherCard>
        </li>
      </ul>
    </div>
  );
};

export default weatherCards;
